import React from 'react';
import {Header,
    TextInput}from 'grommet';

const Login = () => {
return(
    <>
    <Header> Login </Header>
    <Box align="center" justify="center">
<TextInput 
placeholder="Username"
/>
<TextInput 
placeholder="password"
name="password"
htmlFor="password"
type="password"
/>
</Box>
</>
)
};

export default Login;
